import './Home.css';
import Button from '@mui/material/Button';
import { useRouter } from 'next/navigation';

function Home() {
  const router = useRouter();
  return (
    <>
      <h1>Welcome to Best-Fit Colleges</h1> 
      <p className = "descriptions">Find the best colleges for you.</p>
      <div className = "buttons">
        <Button variant="contained" onClick = {router.push('/tab1')}>Search Colleges</Button>
        <Button variant="contained">School Wishlists</Button>
      </div>
    </>
  );
}

export default Home;
